import React, { useState } from 'react';
import './content.css';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import InputRange from 'react-input-range';
import "react-input-range/lib/css/index.css";

function Formbox() {
  const [value, setValue] = useState(1);
  return (
    <div className="box">
      <h1>Form</h1>

      <form>
        <select>
          <option value="Maanantai" defaultValue>Maanantai</option>
          <option value="Tiistai">Tiistai</option>
          <option value="Keskiviikko">Keskiviikko</option>
          <option value="Torstai">Torstai</option>
          <option value="Perjantai">Perjantai</option>
          <option value="Lauantai">Lauantai</option>
          <option value="Sunnuntai">Sunnuntai</option>
        </select>

        <DatePicker
          showTimeSelect
          showTimeSelectOnly
          timeFormat="HH:mm"
          timeIntervals={15}
        />
        <DatePicker
          showTimeSelect
          showTimeSelectOnly
          timeFormat="HH:mm"
          timeIntervals={15}
        />
<br></br>
        <label>Unen laatu:</label>

        <InputRange
          maxValue={5}
          minValue={1}
          value={value}
          onChange={e => setValue(e)}
        />

        <label>Sanallinen arvio:</label><br></br>
        <textarea></textarea>

      </form>

    </div>
  );
}

export default Formbox;
